features.script:
const door = parcel.getFeatureById('garage')

let closed = true
let open = door.createAnimation('rotation')

open.setKeys([{
  frame: 30,
  value: door.rotation.add(new Vector3(Math.PI / 2, 0, 0))
}])


feature.on('click', e => {
  console.log('starting function') 
  if (closed) {
    console.log('beginning closed = true door open animation')
    door.startAnimations([open])
    console.log('setting closed = false after door open animation')  
    closed = false
    console.log('finishing if conditionals')  
  } else {
    console.log('setting closed = true before door close animation')    
    closed = true  
    console.log('beginning closed = false door close animation')  
    door.rotation.set(0,0,-180)
    console.log('finishing else conditionals')   
  }
  console.log('closed: ', closed) 
})

let closed = true;

feature.on('click', e=>{
  if(closed){
    feature.rotation.y=0
  }else{
    feature.rotation.y=1.57
  }
  closed=!closed
})

parcel.on('playerenter', (e)=> {
    console.log('ENTERED: ', e.player.name)
})

parcel.on('playerleave', (e)=> {
    console.log('EXITED: ', e.player.name)
})

feature.on('trigger',e=>{
    console.log(e.player.name, 'stepped on welcoming mat')
})

feature.on('trigger', e => {
  e.player.animate('Sitting')
  console.log(e.player.name, ' sat down')
})
